DROP TABLE IF EXISTS `books`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `books` (
  `BookISBN` bigint NOT NULL,
  `BookTitle` varchar(200) NOT NULL,
  `BookDescription` varchar(1000) NOT NULL,
  `BookIdSeries` int DEFAULT NULL,
  `BookCirculation` int DEFAULT NULL,
  `BookIdPublisher` int NOT NULL,
  `BookIdBinding` int NOT NULL,
  `BookSize` varchar(35) NOT NULL,
  `BookPageCount` int NOT NULL,
  `BookPrice` decimal(5,2) NOT NULL,
  `BookDiscount` int DEFAULT '0',
  `BooksQuantityInNetwork` int DEFAULT '0',
  PRIMARY KEY (`BookISBN`),
  KEY `BookIdSeries` (`BookIdSeries`),
  KEY `BookIdPublisher` (`BookIdPublisher`),
  KEY `BookIdBinding` (`BookIdBinding`),
  CONSTRAINT `BookIdBinding` FOREIGN KEY (`BookIdBinding`) REFERENCES `bookbindings` (`BindingId`),
  CONSTRAINT `BookIdPublisher` FOREIGN KEY (`BookIdPublisher`) REFERENCES `bookpublishers` (`PublisherId`),
  CONSTRAINT `BookIdSeries` FOREIGN KEY (`BookIdSeries`) REFERENCES `bookseries` (`SerieId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
